def first_duplicate(arr):
    seen = set()
    for num in arr:
        if num in seen:
            return num   # Found the first duplicate
        seen.add(num)
    return None   # No duplicates found

# Example usage
print(first_duplicate([2, 1, 3, 5, 3, 2]))  # Output: 3
print(first_duplicate([1, 2, 3, 4]))        # Output: None
